     echoReply(0),
     destinationUnreachable(3),
     sourceQuench(4),
     redirect(5),
     echoRequest(8),
     timeExceeded(11),
     parameterProblem(12),
     timestampRequest(13),
     timestampReply(14),
     informationRequest(15),
     informationReply(16),
     addressMaskRequest(17),
